import React from 'react';

function Hero() {
    return ( 
        <div className='container'>
            <div className='row'>
                <div className='d-inline p-2 bg-primary text-white'>
                    <h1 className='heading-dark'>Support Portal</h1>
                    <button className='p-2 btn btn-primary'>My tickets</button>
                </div>
            </div>
        </div>
     );
}

export default Hero;
